import React from 'react';
import './ResultCard.css';

const ResultCard = ({ result }) => {
    // Handle possible missing values in result object
    const title = result.title || result.snippet || "No title available";
    const description = result.description || result.snippet || "No description available";

    return (
        <div className="result-card">
            <h3>{title}</h3>
            <p>{description}</p>

            {/* Conditional rendering based on the result type */}
            {result.type === 'youtube' && result.id && result.id.videoId && (
                <a href={`https://www.youtube.com/watch?v=${result.id.videoId}`} target="_blank" rel="noopener noreferrer">
                    Watch Video
                </a>
            )}

            {result.type === 'google' && result.link && (
                <a href={result.link} target="_blank" rel="noopener noreferrer">
                    Read More
                </a>
            )}

            {result.type === 'paper' && result.url && (
                <a href={result.url} target="_blank" rel="noopener noreferrer">
                    View Paper
                </a>
            )}

            {result.type === 'blog' && result.url && (
                <a href={result.url} target="_blank" rel="noopener noreferrer">
                    Read Blog
                </a>
            )}
        </div>
    );
};

export default ResultCard;
